This Box ~ My transitional treasure, my daily death;
Today, I'm imbibed into this flickering crystal quod.!

I cannot recollect the residues of my withered imagination,
As I drown myself in the monotonous clockwork of this ever rolling prism;

Even the darkness had that for me..
The lure that pulled me into the depths of this ecstasy;

I cannot decide if I'm drowning in the hell of it or caught in the act to insensate the hell of it.!

Content : Mahesh Krishnan (Bohomonk)

